DROP TABLE IF EXISTS `sys_job`;
CREATE TABLE `sys_job` (
`job_id`  bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT ,
`job_name`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '任务名称' ,
`job_class`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '任务执行类' ,
`status`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1' ,
`cron_expression`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '任务运行时间表达式' ,
`gmt_create`  datetime NOT NULL ,
`gmt_modified`  datetime NULL DEFAULT NULL ,
PRIMARY KEY (`job_id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=9

;

